Let's design a computational model to predict responder acceptance behavior in this economic game.  The key psychological mechanisms likely at play are:

1. **Fairness:** Responders likely consider whether the proposed split is fair relative to their contribution (`token_self`) and the opponent's contribution (`token_opp`).  A simple ratio of contributions could represent this.  A perfectly fair split would have a ratio of 1.

2. **Self-interest:** Responders prioritize maximizing their own monetary gain (`split_self`).

3. **Risk aversion:** Responders may be averse to the risk of receiving nothing if they reject the offer. This is implicitly captured by the binary choice between accepting a proposed amount, or receiving nothing.

4. **Trial Type and Role:** The trial type (equal, opponent more, participant more) and the participant's role (responder) provide contextual information which will likely influence the decision making process.  We will include these as modulating factors on the utility function.


These mechanisms interact in a complex way.  A responder's acceptance decision depends on a weighing of fairness concerns against self-interest, modified by their level of risk aversion. The trial type and role will likely influence the weights given to each of these considerations.


A mathematical form that could capture these interactions is a weighted linear combination of the fairness ratio, self-interest, and a risk aversion term, modulated by the trial type and role.  We can use a logistic function to convert the utility into a probability of acceptance.


To calibrate the model, we need parameters to weigh the different factors:

* A weight for fairness (`fairness_weight`)
* A weight for self-interest (`self_interest_weight`)
* A parameter reflecting risk aversion (`risk_aversion_param`). This will be tied to the amount of money at stake.


The model variables map to observable behavior as follows: higher utility values (above 0) should correspond to higher probabilities of acceptance, and vice versa.


<MODEL>
U =  (fairness_weight * (token_self / token_opp)) + (self_interest_weight * split_self) - (risk_aversion_param * combined_earning) + trial_type_effect + trial_role_effect
P(accept) = 1 / (1 + exp(-U))
</MODEL>

